script: |
  super -f text -I q8903.spq | sort > q8903.out

inputs:
  - name: q8903.spq
    data: |
      SELECT ALL - col2 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT + col1 * - col1 * + - col0 + - - col2 + col2 < col0 * - + 40 * + col0 + - - col2;
  - name: tab1

outputs:
  - name: q8903.out
    data: |
      -59
      -68
      -96
